import React from 'react'
import { Link } from 'react-router-dom'

function Navbar(){
    return(
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/signup">Sign Up</Link></li>
          <li><Link to="/login">Login</Link></li>
        </ul>
    )
}

export default Navbar
